def verificar_status_m3u(link_m3u):
    global usuario, senha, host
    parsed_url = urlparse(link_m3u)
    query_params = parse_qs(parsed_url.query)
    full_url = parsed_url.scheme + "://" + parsed_url.netloc
    host = parsed_url.hostname
    usuario = query_params['username'][0]
    senha = query_params['password'][0]
    link = f"{full_url}/player_api.php?username={usuario}&password={senha}&type=m3u"

    session = requests.Session()
    try:
        response = session.get(link, headers=headers, timeout=3, verify=False)
        data = str(response.text)

        if 'username' in data:
            status = data.split('status":')[1]
            status = status.split(',')[0]
            status = status.replace('"', '')
            if status == 'Active':
                return "Ativo"
            else:
                return "Inativo"
        else:
            return "Inativo"

    except requests.exceptions.Timeout:
        return "Inativo"
    except requests.exceptions.RequestException as e:
        return "Inativo"

